import React from 'react';

import Homepage from './pages/homepage/homepage.component';
import ToDoList from './pages/todo-list/todo-list.component';

import './App.scss'

function App() {
  return (
    <div className="app-wrapper">
      <div className="main-container">
        <Homepage />
        <ToDoList />
      </div>
    </div>
  );
}

export default App;
